import React from "react"
import { BrowserRouter as Router, Route, Switch, Link } from "react-router-dom";
import Register from "./page/Register/Register"
import'./App.css';

function App() {
  return (
    <Router>
      <div>
        <Switch>
            <Route path="/register">
              <Register/>
            </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
